import React from "react";

class H1header extends React.Component {
  render() {
    return (
      <>
        <h1>First react app</h1>
        <div className="-row"></div>
        <button>1</button>
        <button>2</button>
        <button>3</button>
        <div className="-row"></div>
        <button>4</button>
        <button>5</button>
        <button>6</button>
        <div className="-rw"></div>
        <button>7</button>
        <button>8</button>
        <button>9</button>
      </>
    );
  }
}

export default H1header;
